backupResetTip:"",ddns:"Привязать неизмененное наименование домена и IP-адрес интерфейса WAN маршрутизатора. Таким образом, при связи главной машины интернета с маршрутизатором разрешен доступ с помощью наименования домена.",ddnsProvider:"Поставщик услуг",ddnsProviderOray:'Поставщик динамического DNS данного маршрутизатора <b> скорлупа земляного арахиса </b> (<i><a href="http://www.oray.com"  target="_blank">www.oray.com</a></i>) и  <b> общественное облако </b>(<i><a href="http://www.pubyun.com"  target="_blank">www.pubyun.com</a></i>).',
ddnsTip:"Данная функция использует зарегистрированный в скорлупе земляного арахиса (или общественном облаке) логин/пароль для входа в скорлупу земляного арахиса (или общественное облако). После удачного входа показывается тип услуги, информация о типе услуги и состояния входа текущего пользователя.",deviceMng:"Можно просмотреть список терминалов подключения к интернету, список оффлайновых терминалов, список запрещенных терминалов. Разрешено редактирование оборудования во списке для осуществления запрещения подключения оборудования к интернету, редактирования наименования оборудования, ограничения скорости оборудования и других функций.",
deviceMngTip:"",deviceMngTip1:"",forbidInternet:"Запрещение подключения оборудования к интернету",forbidInternetTip:"Запрещено подключение текущего подключенного оборудования к интернету",rename:"Редактировать наименование оборудования",renameTip:"Изменить наименование текущего подключенного оборудования, в наименовании может содержаться иероглиф, буква, цифра и назначенные особые символы.",renameTip1:"",speedLimit:"Ограничение скорости",speedLimitTip:"Ограничивают скорость загрузки и скачивания назначенного подключенного оборудования с помощью настройки величины ограничения скорости.",
dhcp:"Услуги DHCP",dhcpTip:"Сервер DHCP автоматически распределяет оборудованию локальной сети IP, маску подсети и другие параметры протокола TCP/IP.",addressPool:"Пределы распределения IP",addressPoolTip:"Начальный/конечный адрес IP, автоматически распределенный сервером DHCP.",ipMacBind:"Привязка IP-адреса и MAC-адреса",ipMacBindTip:"Распределяют неизмененный IP-адрес оборудованию, требующему подключения к интернету, одновременно привязать IP-адрес и MAC-адрес, чтобы предупредили атаку ARP на оборудование.",
