wanMacClone:"",wanMacCloneTip:"",wanSelfDefDNS:"",wanSelfDefDNSTip:"",offlineDownload:"После включения в маршрутизаторе создается задача скачивания для непосредственного скачивания содержания в оборудовании хранения, присоединенном к маршрутизатору.",offlineDownloadTip:"Рекомендуется заблаговременное создание задачи скачивания без использования сети, при повторном использовании сети можно просмотреть заблаговременно скаченные файлы, что экономит время и удобно.",parentCtrl:"Вы можете удобно управлять временем подключения оборудования, используемого ребенком, к интернету, с помощью родительского управления. Настройка времени может уточнить до каждой недели, каждого дня, каждого часа и каждой минуты. Вы можете установить не более 10 правил по ограничению подключения к интернету.",
