timeSleep:"Установить, чтобы маршрутор вошел в состояние покоя в свободное время для снижения рассеиваемой мощности маршрутизатора. При истечении назначенного времени восстановить маршрутизатор в состояние до покоя с помощью процедуры самопуска.",timeSleepTip1:"Во время покоя маршрутизатора разрешен принудительный выход из состояния покоя с помощью отключения электропитания и перезапуска.",timeSleepTip2:"При одинаковом времени начала и конца назначенного времени настройка покоя не вводится в действие. Кроме того, если текущее время маршрутизатора не синхронизируется с сетевым временем, данная функция не действует, одновременно проверите, пожалуйста, нормальность подключения к интернету.",
